import React, { useEffect, useState } from "react";
import { RouteComponentProps, withRouter } from "react-router";

type BookDetailParams = {
  id: string;
};
type BookDetailProps = RouteComponentProps<BookDetailParams>;

const BookDetail: React.FC<{ match: any }> = ({ match }) => {
  useEffect(() => {
    fetchItem();
  }, []);

  const [item, setItem] = useState({
    id: Number,
    name: String,
    username: String,
    email: String,
    address: {
      street: String,
      suite: String,
      city: String,
      zipcode: Number,
      geo: {
        lat: Number,
        lng: Number,
      },
    },
    phone: Number,
    website: String,
    company: {
      name: String,
      catchPhrase: String,
      bs: String,
    },
  });

  const fetchItem = async () => {
    const fetchItem = await fetch(
      `https://jsonplaceholder.typicode.com/users/${match.params.id}`
    );
    const item = await fetchItem.json();
    setItem(item);
    // console.log(item);
    // const result = await axios("https://jsonplaceholder.typicode.com/users/1");
    // setdataProfile(result);
    // console.log(result.data);
  };
  console.log(item.id);

  return (
    <div>
      Book ID: {match.params.id}
      <div>{item.id}</div>
      <div>{item.name}</div>
      <div>{item.username}</div>
      <div>{item.email}</div>
      {/* <div>{item.address}</div> */}
      <div>
        Adress:
        {item.address.street}
        {item.address.suite}
        {item.address.city}
        {item.address.zipcode}
      </div>
      {/* <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>v<div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div>
      <div>{item.id}</div> */}
    </div>
  );
};
export default withRouter(BookDetail);
